// Header.js
import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import './Header.css';

const Header = () => {
  const [isScrolled, setIsScrolled] = useState(false);

  useEffect(() => {
    const handleScroll = () => {
      const scrollPosition = window.scrollY;
      setIsScrolled(scrollPosition > 50);
    };

    window.addEventListener('scroll', handleScroll);

    return () => {
      window.removeEventListener('scroll', handleScroll);
    };
  }, []);

  const headerClass = isScrolled ? 'header opaque' : 'header';

  return (
    <header className={headerClass}>
      <nav className="nav navbar navbar-expand-md mb-4">
      <Link to="/" className="logo navbar-brand">Elizabeth</Link>

        <ul class="nav nav-pills">
        <li class="nav-item"><Link to="/">Home</Link></li>
        <li class="nav-item"><Link to="/services">Services</Link></li>
        <li class="nav-item"><a href="#" class="nav-link">Pricing</a></li>
        <li class="nav-item"><Link to="/contact">Contact</Link></li>
        <li class="nav-item"><Link to="/testimonials">Testimonials</Link></li>
      </ul>
      </nav>
    </header>
  );
};

export default Header;
